import React from 'react';

const ItemsList = (props) => {
    return (
        <>
            {props.images.map((image) =>
            (
                <div key={image.id} className='col-auto'>
                    <img src={image.previewURL} alt='' />
                </div>
            )
            )}
        </>
    );
};
export default ItemsList;
